  def newAddrMRangeSameLengthAsOriginalAddrMRange(newAddrMRange: AddrMRange, originalAddrMRange: AddrMRange): Boolean = {
    (newAddrMRange.end - newAddrMRange.start) == (originalAddrMRange.end - originalAddrMRange.start)
  }

