      projectLinkDAO.create(projectLinks)
      projectService.recalculateProjectLinks(projectId, "test", Set(roadPart1))

      val recalculated = projectLinkDAO.fetchProjectLinks(projectId)
      recalculated.size should be (87)

      // All project links should have same length addrMRange and originalAddrMRange
      recalculated.foreach(pl => {
        newAddrMRangeSameLengthAsOriginalAddrMRange(pl.addrMRange, pl.originalAddrMRange) should be (true)
      })

      val terminated = recalculated.filter(_.status == RoadAddressChangeType.Termination)
      val terminatedAddrMRanges = terminated.map(_.addrMRange)
      terminatedAddrMRanges.size should be (4)

      val terminatedLeftSideFirst = recalculated.find(_.linkId == "197d3ccd-41f4-4bc1-bf19-7885b20eb2a0:2")
      val terminatedLeftSideSecond = recalculated.find(_.linkId == "a6b1f511-290f-4c13-a263-a5d2593c8be5:2")

      val terminatedRightSideFirst = recalculated.find(_.linkId == "47f40bb1-2402-4d21-a08e-785cb6019f6e:2")
      val terminatedRightSideSecond = recalculated.find(_.linkId == "fde53c39-c1a7-4744-8184-92b385c25953:2")

      val lefSideMinorDiscontinuityLink = recalculated.find(_.linkId == "13e953e2-2aa5-4344-b5a7-dc0954fd9cc0:2")
      val rightSideMinorDiscontinuityLink = recalculated.find(_.linkId == "eaf57b8c-25ad-4062-a9fd-25cb6477651b:2")

      // The links before the terminated section should have the same end addrMValue as the terminated sections start addrMValue
      lefSideMinorDiscontinuityLink.get.addrMRange.end should be (terminatedLeftSideFirst.get.addrMRange.start)
      rightSideMinorDiscontinuityLink.get.addrMRange.end should be (terminatedRightSideFirst.get.addrMRange.start)

      val leftSideAfterTerminatedSegment = recalculated.find(_.linkId == "d0137cd5-fb83-48f2-8bad-1953e1c4a0d9:2")
      val rightSideAfterTerminatedSegment = recalculated.find(_.linkId == "82ed536a-5d46-41c4-a464-0a087a2f06be:2")

      // The links after the terminated segment should have original start addrMValues matching with the end addrMValues of the terminated section
      leftSideAfterTerminatedSegment.get.originalAddrMRange.start should be (terminatedLeftSideSecond.get.addrMRange.end)
      rightSideAfterTerminatedSegment.get.originalAddrMRange.start should be (terminatedRightSideSecond.get.addrMRange.end)

      // The links after the terminated segment should have start addrMValues matching with the end addrMValues of the minor discontinuity links
      leftSideAfterTerminatedSegment.get.addrMRange.start should be (lefSideMinorDiscontinuityLink.get.addrMRange.end)
      rightSideAfterTerminatedSegment.get.addrMRange.start should be (rightSideMinorDiscontinuityLink.get.addrMRange.end)
    }
