      projectLinkDAO.create(projectLinks)
      projectService.recalculateProjectLinks(projectId, "test", Set(roadPart1))

      val recalculated = projectLinkDAO.fetchProjectLinks(projectId)
      recalculated.size should be (62)

      // All project links should have same length addrMRange and originalAddrMRange
      recalculated.foreach(pl => {
        newAddrMRangeSameLengthAsOriginalAddrMRange(pl.addrMRange, pl.originalAddrMRange) should be (true)
      })

      val terminated = recalculated.filter(_.status == RoadAddressChangeType.Termination)
      val terminatedAddrMRanges = terminated.map(_.addrMRange)
      terminatedAddrMRanges.size should be (2)
      terminatedAddrMRanges.head should be (terminatedAddrMRanges.last)

      val lefSideMinorDiscontinuityLink = recalculated.find(_.linkId == "4ea21d39-d2d6-4670-9c6f-9fe3fe07841d:1")
      val rightSideMinorDiscontinuityLink = recalculated.find(_.linkId == "aa5a1229-104f-462c-a869-0cc155174bcb:1")

      // The links before the terminated section should have the same end addrMValue as the terminated sections start addrMValue
      lefSideMinorDiscontinuityLink.get.addrMRange.end should be (terminatedAddrMRanges.head.start)
      rightSideMinorDiscontinuityLink.get.addrMRange.end should be (terminatedAddrMRanges.head.start)

      val leftSideAfterTerminatedSegment = recalculated.find(_.linkId == "eefa949a-a756-4489-8b5a-7feb7c3567de:1")
      val rightSideAfterTerminatedSegment = recalculated.find(_.linkId == "b900c2c8-407b-4d1e-bae7-b0bef2b3d36b:1")

      // The links after the terminated segment should have original start addrMValues matching with the end addrMValues of the terminated links
      leftSideAfterTerminatedSegment.get.originalAddrMRange.start should be (terminatedAddrMRanges.head.end)
      rightSideAfterTerminatedSegment.get.originalAddrMRange.start should be (terminatedAddrMRanges.head.end)

      // The links after the terminated segment should have start addrMValues matching with the end addrMValues of the minor discontinuity links
      leftSideAfterTerminatedSegment.get.addrMRange.start should be (lefSideMinorDiscontinuityLink.get.addrMRange.end)
      rightSideAfterTerminatedSegment.get.addrMRange.start should be (rightSideMinorDiscontinuityLink.get.addrMRange.end)
    }
