      val withoutTerminated = projectLinks.filterNot(_.status == RoadAddressChangeType.Termination)
      projectService.recalculateProjectLinks(projectId, "test", Set(roadPart))
      val recalculated = projectLinkDAO.fetchProjectLinks(projectId)
      recalculated.length should be (39) // same amount as before calculation (note: includes the terminated projectLinks)
      val sorted = recalculated.sortBy(pl => (pl.originalAddrMRange.start))
      val (terminated, nonTerminated) = sorted.partition(_.status == RoadAddressChangeType.Termination)
      terminated.size should be (2) // there should be the same amount of terminated links as before calculation (i.e. no splits needed)
      terminated.filter(_.track == Track.LeftSide).head.addrMRange.start should be (nonTerminated.filter(_.track == Track.LeftSide).last.addrMRange.end) // terminated link should still be "continuous" with the previous unChanged link
      terminated.filter(_.track == Track.RightSide).head.addrMRange.start should be (nonTerminated.filter(_.track == Track.RightSide).last.addrMRange.end)
      val endAddrMValueOnMinorDiscontinuity = nonTerminated.filter(_.discontinuity == Discontinuity.MinorDiscontinuity).map(_.addrMRange.end).distinct
      endAddrMValueOnMinorDiscontinuity.size should be (1) // endAddrMValue should be the same on both tracks at the new minor discontinuity spot
      nonTerminated.filter(_.track == Track.Combined).head.addrMRange.start should be (endAddrMValueOnMinorDiscontinuity.head) //combined section startAddressMValue should be the same as the endAddrMValue of the minor discontinuity links
      nonTerminated.filter(_.status != RoadAddressChangeType.Transfer).foreach(pl => pl.addrMRange.start should be (pl.originalAddrMRange.start)) // addressMValues should match original addressMValues on all links except Transferred links
      nonTerminated.filter(_.status != RoadAddressChangeType.Transfer).foreach(pl => pl.addrMRange.end should be (pl.originalAddrMRange.end))
